        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "ພາຍໃຕ້ກົດໝາຍຂອງ ສປປ ລາວ, ຂໍ້ມູນຂອງຜູ້ໃຊ້ເຊັ່ນ: ຊື່, ທີ່ຢູ່ອີເມວ, ລະຫັດຜ່ານ ແລະວັນເດືອນປີເກີດສາມາດຈັດປະເພດເປັນ “ຂໍ້ມູນສ່ວນຕົວ.\n\n ໂດຍ​ສະ​ເພາະ,\n (a) ພາຍໃຕ້ດໍາລັດ, ຂໍ້ມູນສ່ວນບຸກຄົນໄດ້ຖືກກໍານົດເປັນຂໍ້ມູນທີ່ຕິດກັບການກໍານົດຕົວຕົນແລະລາຍລະອຽດສ່ວນບຸກຄົນຂອງບຸກຄົນລວມທັງຊື່, ອາຍຸ, ທີ່ຢູ່, ເລກບັດປະຈໍາຕົວຂອງປະຊາຊົນ, ເບີໂທລະສັບ, ທີ່ຢູ່ອີເມວແລະຂໍ້ມູນອື່ນໆ. ຕາມ​ທີ່​ໄດ້​ກຳນົດ​ໄວ້​ໃນ​ກົດໝາຍ\n\n (b) ພາຍໃຕ້, ຂໍ້ມູນສ່ວນບຸກຄົນຫມາຍເຖິງຂໍ້ມູນທີ່ພຽງພໍເພື່ອກໍານົດບຸກຄົນຢ່າງຊັດເຈນ, ເຊິ່ງປະກອບມີຢ່າງຫນ້ອຍຫນຶ່ງໃນລາຍລະອຽດດັ່ງຕໍ່ໄປນີ້: ຊື່ເຕັມ, ວັນເດືອນປີເກີດ, ອາຊີບ, ຫົວຂໍ້, ທີ່ຢູ່ຕິດຕໍ່, ທີ່ຢູ່ອີເມວ, ເບີໂທລະສັບ, ຕົວຕົນ. ໝາຍເລກບັດ ແລະໝາຍເລກໜັງສືຜ່ານແດນ. ຂໍ້​ມູນ​ຂອງ​ຄວາມ​ເປັນ​ສ່ວນ​ຕົວ​ຂອງ​ສ່ວນ​ບຸກ​ຄົນ​ປະ​ກອບ​ມີ​ບັນ​ທຶກ​ສຸ​ຂະ​ພາບ​, ບັນ​ທຶກ​ການ​ຈ່າຍ​ພາ​ສີ​, ເລກ​ບັດ​ປະ​ກັນ​ໄພ​ສັງ​ຄົມ​, ເລກ​ບັດ​ເຄຣ​ດິດ​ແລະ​ຄວາມ​ລັບ​ສ່ວນ​ບຸກ​ຄົນ​ອື່ນໆ​.\n\n ນຳໃຊ້ກັບການເກັບກຳ ແລະ ນຳໃຊ້ຂໍ້ມູນສ່ວນຕົວໂດຍເວັບໄຊທີ່ດຳເນີນໂດຍອຳນາດການປົກຄອງລັດຖະບານ ສປປ ລາວ. ບໍ່ສາມາດໃຊ້ໄດ້ໂດຍກົງກັບການເກັບກຳ ແລະ ນຳໃຊ້ຂໍ້ມູນສ່ວນຕົວໂດຍເວັບໄຊທ໌ທີ່ດຳເນີນງານໂດຍໜ່ວຍງານທີ່ບໍ່ຂຶ້ນກັບລັດຖະບານ. ຢ່າງໃດກໍ່ຕາມ, ຂໍ້ກໍານົດສາມາດຖືກນໍາໃຊ້ໂດຍການປຽບທຽບ. ນອກຈາກນັ້ນ, ມັນເປັນໄປໄດ້ວ່າຫົວໜ່ວຍທີ່ບໍ່ຂຶ້ນກັບລັດຖະບານຈະຢູ່ພາຍໃຕ້ມາດຕະຖານດຽວກັນ ຫຼື ເຂັ້ມງວດກວ່າທີ່ນຳໃຊ້ກັບໜ່ວຍງານຂອງລັດຖະບານ."),
